    state = {
        item: this.customer
    };

    async componentDidMount() {
        const customers = await (await fetch(`/api/customer/`)).json();
        this.setState({item: customers});
        console.log(this.state.item);
    }
    render() {
        return <div className='home-wrap'>
            111
            {this.state.item}
        </div>
    }
}
